import React from 'react';
import HeaderComponent from './components/header';
class Helloword extends React.Component {
	render() {
		return (
			<React.Fragment>
				<HeaderComponent />
				<h1>Hello word</h1>
			</React.Fragment>
		);
	}
}
export default Helloword;
